import classes from './SearchResultsList.module.css';

function SearchResultsList(props){
    console.log(props.filteredQueries);
    return (
        <div className={classes['results-list']}>
            {props.filteredQueries.map((word) => (
                <div className={classes.results}>{word}</div>

            ))}
        </div>
    );
}

export default SearchResultsList;
